import React, {useEffect} from 'react';
import {
  MDBNavbar,
  MDBContainer,
  MDBNavbarBrand,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownItem,
  MDBIcon,
  MDBDropdownMenu,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBCollapse,
  MDBNavbarToggler
} from 'mdb-react-ui-kit';
import { useLocation, useNavigate } from "react-router-dom";

// import logo from '../assets/pos.png';
import { clearStorage,getStorage } from '../../Helper';


export default function Navbar() {
  const navigate = useNavigate();
  const location = useLocation();
  const [openToggle, setOpenToggle] = React.useState('');
  const [user, setUser] = React.useState('');

  useEffect(()=>{
    setUser(JSON.parse(getStorage('user')));
  },[])
  const logout = () =>{
    clearStorage('');
    setUser('')
    navigate('/')
  }
  return (
    <div>
      <MDBNavbar fixed='top' expand='lg' color="light" bgColor='light'>
        <MDBContainer fluid>
          <MDBNavbarBrand href='#'>
            <img
              src={logo}
              height='30'
              alt=''
              loading='lazy'
            />
            POS
          </MDBNavbarBrand>

          <MDBNavbarToggler
            type='button'
            data-target='#navbarColor02'
            aria-controls='navbarColor02'
            aria-expanded='false'
            aria-label='Toggle navigation'
            onClick={() => setOpenToggle(!openToggle)}
          >
            <MDBIcon icon='bars' fas color='primary' />
          </MDBNavbarToggler>
          <MDBCollapse open={openToggle} navbar>


            <MDBNavbarNav className='me-auto'>
              <MDBNavbarItem className='active'>
                {/* <MDBNavbarLink active={location.pathname === '/dashboard'} aria-current='page' href='/dashboard'>
                  Home
                </MDBNavbarLink> */}
              </MDBNavbarItem>
            </MDBNavbarNav>


            <MDBDropdown color="primary" >
              <MDBDropdownToggle color='link' caret="true">
               {user.user} &nbsp;
                <MDBIcon icon="user" />
              </MDBDropdownToggle>
              <MDBDropdownMenu>
                <MDBDropdownItem link onClick={logout}>Logout</MDBDropdownItem>
              </MDBDropdownMenu>
            </MDBDropdown>

          </MDBCollapse>
        </MDBContainer>
      </MDBNavbar>
    </div>
  );
}
